import axios from 'axios';

const url = 'https://covid19.mathdro.id/api'; 

export const fetchdata = async () => {
    try{
        const { data } = await axios.get(url);

        const modifiedData = {
            confirmed,
            recovered,
            deaths: data.deaths,
            lastUpdate: data.lastUpdate
        }

        return modifiedData; 
    }
    catch (error) {

    }
}
